import React from 'react';
import PropTypes from 'prop-types';

Panigation.propTypes = {
    panigation: PropTypes.object.isRequired,
    onPageChange: PropTypes.func,
};

Panigation.defaultProps = {
    onPageChange: null
};

function Panigation(props) {
    const{panigation, onPageChange} =props;
    const{_page, _limit, _totalRow} = panigation;
    const totalPages = Math.ceil(_totalRow / _limit);
    function hangePageChange(newPage){
        if(onPageChange){
            onPageChange(newPage);
        }
    }
    return (
        <div>
            <button disabled={_page <=1} onClick={()=>hangePageChange(_page-1)}>Prev</button>
            <button disabled={_page >= totalPages} onClick={()=>hangePageChange(_page+1)}>Next</button>
        </div>
    );
}

export default Panigation;
